import Footer from "./Components/Footer";
import Navbar from "./Components/Navbar";


function App() {
  return (
    <div className="App">
    <ContextProvider>
      <BrowserRouter>
        <Navbar />
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/detail/:id" element={<Detail />} />
          <Route path="/favorites" element={<Favs />} />
          <Route path="/contact" element={<Contact />} />
        </Routes>
      </BrowserRouter>
      <Footer />
    </ContextProvider>
  </div>
  );
}

export default App;
